import React from "react";
import { useForm } from "react-hook-form";

const LoginForm = () => {
    return (
        <form>
            <div className="mb-3">
                <label for="emailAddress" className="form-label">
                    Email address
                </label>
                <input
                    type="email"
                    className="form-control"
                    id="emailAddress"
                    aria-describedby="emailHelp"
                />
            </div>
        </form>
    );
};

export default LoginForm;
